import React, { Component } from "react";
import { Link } from "react-router-dom";
import Modal from 'react-awesome-modal';
import './style.css';
import M from "materialize-css";

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
        visible : false
    }
  }

  openModal() {
      this.setState({
          visible : true
      });
  }

  closeModal() {
      this.setState({
          visible : false
      });
  }

  componentDidMount() {
      // Auto initialize all the things!
      M.AutoInit();
  }

  render() {

  return (
        <div>
            <nav className="z-depth-0">
                <div className="nav-wrapper blue darken-1">
                <Link style={{ padding: "0 0 0 15px" }}className="brand-logo" to="/"><b>Patrick Kennedy</b></Link>
                <a href="#!" data-target="mobile-demo" className="sidenav-trigger"><i className="material-icons">menu</i></a>
                <ul className="right hide-on-med-and-down">
                    <li><Link to="/resume"><b>Resume</b></Link></li>
                    <li><Link to="/aboutme"><b>About Me</b></Link></li>
                    <li><Link to="/portfolio"><b>Portfolio</b></Link></li>
                    <li><Link onClick={() => this.openModal()}><b>Contact Me</b></Link></li>
                </ul>
                </div>
            </nav>

            <ul className="sidenav" id="mobile-demo">
                <li><Link to="/resume">Resume</Link></li>
                <li><Link to="/aboutme">About Me</Link></li>
                <li><Link to="/portfolio">Portfolio</Link></li>
                <li><Link to="/contactme">Contact Me</Link></li>
            </ul>

            <Modal visible={this.state.visible} width="400" height="300" effect="fadeInUp" onClickAway={() => this.closeModal()}>
                    <div>
                    <div style={{margin: '150px auto 0 auto'}} className='container'>
            <div className='row'>
                <div className='col s12 m6'>
                    <div className='col s12'>
                        <h1 className='blue-text'><b>REACH</b>ME</h1>
                    </div>
                    <div className='col s4 blue-text'><hr/></div>
                    <div className='col s12'>
                        <h5 className='blue-text'><b><i><i style={{verticalAlign: 'middle'}} class="small material-icons">send</i> pkennedytx1@gmail.com</i></b></h5>
                    </div>
                    <div className='col s12'>
                        <a rel="noopener noreferrer" href="https://www.linkedin.com/in/patrick-kennedy-262198170/" target="_blank" ><h5 className='blue-text' ><b>Linked</b><i class="fab fa-linkedin"></i></h5></a>
                    </div>
                </div>
                <div className='col s12 m6'>
                    <div className='col s12'>
                        <h1 className='blue-text'><b>MY</b>INFO</h1>
                    </div>
                    <div className='col s4 blue-text'><hr/></div>
                    <div className='col s12'>
                        <h5 className="blue-text"><a style={{fontSize: '45px', verticalAlign: 'middle', margin: '0 25px 0 auto'}} href="https://github.com/pkennedytx1" rel="noopener noreferrer" target="_blank"><i className="fab fa-github"></i></a> | <a style={{textDecoration: 'none', margin: '0 auto 0 25px'}} href="/images/Patrick_Kennedy_Resume.pdf" download><i className="fas fa-download"></i> <b> Resume</b></a></h5>
                    </div>
                </div>
            </div>
        </div>
                        <a href="javascript:void(0);" onClick={() => this.closeModal()}>Close</a>
                    </div>
                </Modal>
        </div>
      ) 
    }
  }

export default Navbar;
